public class InnerFlowDestinationConnectorPropertiesFactory(Action<Humidifier.AppFlow.FlowTypes.DestinationConnectorProperties> factoryAction = null) : SubResourceFactory<Humidifier.AppFlow.FlowTypes.DestinationConnectorProperties>
{

    internal InnerFlowS3DestinationPropertiesFactory S3Factory { get; set; }

    internal InnerFlowCustomConnectorDestinationPropertiesFactory CustomConnectorFactory { get; set; }

    internal InnerFlowUpsolverDestinationPropertiesFactory UpsolverFactory { get; set; }

    internal InnerFlowSAPODataDestinationPropertiesFactory SAPODataFactory { get; set; }

    internal InnerFlowSnowflakeDestinationPropertiesFactory SnowflakeFactory { get; set; }

    internal InnerFlowLookoutMetricsDestinationPropertiesFactory LookoutMetricsFactory { get; set; }

    internal InnerFlowEventBridgeDestinationPropertiesFactory EventBridgeFactory { get; set; }

    internal InnerFlowZendeskDestinationPropertiesFactory ZendeskFactory { get; set; }

    internal InnerFlowMarketoDestinationPropertiesFactory MarketoFactory { get; set; }

    internal InnerFlowRedshiftDestinationPropertiesFactory RedshiftFactory { get; set; }

    internal InnerFlowSalesforceDestinationPropertiesFactory SalesforceFactory { get; set; }

    protected override Humidifier.AppFlow.FlowTypes.DestinationConnectorProperties Create()
    {
        var destinationConnectorPropertiesResult = CreateDestinationConnectorProperties();
        factoryAction?.Invoke(destinationConnectorPropertiesResult);

        return destinationConnectorPropertiesResult;
    }

    private Humidifier.AppFlow.FlowTypes.DestinationConnectorProperties CreateDestinationConnectorProperties()
    {
        var destinationConnectorPropertiesResult = new Humidifier.AppFlow.FlowTypes.DestinationConnectorProperties();

        return destinationConnectorPropertiesResult;
    }
    public override void CreateChildren(Humidifier.AppFlow.FlowTypes.DestinationConnectorProperties result)
    {
        base.CreateChildren(result);

        result.S3 ??= S3Factory?.Build();
        result.CustomConnector ??= CustomConnectorFactory?.Build();
        result.Upsolver ??= UpsolverFactory?.Build();
        result.SAPOData ??= SAPODataFactory?.Build();
        result.Snowflake ??= SnowflakeFactory?.Build();
        result.LookoutMetrics ??= LookoutMetricsFactory?.Build();
        result.EventBridge ??= EventBridgeFactory?.Build();
        result.Zendesk ??= ZendeskFactory?.Build();
        result.Marketo ??= MarketoFactory?.Build();
        result.Redshift ??= RedshiftFactory?.Build();
        result.Salesforce ??= SalesforceFactory?.Build();
    }

} // End Of Class

